import React, { useState } from "react";
import { Outlet, Link } from "react-router-dom";
import logo from "../assets/logo.png";
import { BurgerVeggie as Burger } from "react-burger-icons";

export function useHorizontalScroll() {
  const elRef = useRef();
  useEffect(() => {
    const el = elRef.current;
    if (el) {
      const onWheel = (e) => {
        if (e.deltaY == 0) return;
        e.preventDefault();
        el.scrollTo({
          left: el.scrollLeft + e.deltaY,
          behavior: "smooth",
        });
      };
      el.addEventListener("wheel", onWheel);
      return () => el.removeEventListener("wheel", onWheel);
    }
  }, []);
  return elRef;
}

function Layout() {
  const [isClosed, setIsClosed] = useState(false);
  const toggleClosed = () => setIsClosed(!isClosed);

  return (
    <div>
      <header>
        <div className="menu-container">
          <div className="header-container">
            <div className="logo-container">
              <Link to="/">
                <img src={logo} alt="zagazine" className="logo" />
              </Link>
            </div>
            <div className="options-container">
              <Link to="/aboutus" className="button-contact">
                ¿Quienes somos?
              </Link>
              <button
                type="button"
                className="button-menu"
                onClick={toggleClosed}
              >
                <Burger isClosed={isClosed} />
              </button>
            </div>
          </div>
          <div className="section-container" ref={scrollRef}>
            <Link to="/list_articles/1">¿Qué ver y escuchar?</Link>
            <Link to="/list_articles/2">Food & Drinks</Link>
            <Link to="/list_articles/3">Apps & Gadgets</Link>
            <Link to="/list_articles/4">Socialité</Link>
            <Link to="/list_articles/5">Bienestar</Link>
            <Link to="/list_articles/6">Bussines</Link>
            <Link to="/list_articles/7">Acción</Link>
            <Link to="/list_articles/8">Moda</Link>
            <Link to="/list_articles/9">Opinión</Link>
            <Link to="/list_articles/10">Who to follow?</Link>
          </div>
        </div>
      </header>
      <Outlet />
      <footer className="container-footer">
        <div className="container-social">
          <div>
            <h1>Mantente conectado</h1>
            <div className="container-pharse">
              <p>Síguenos en nuestras redes y dale un vistaso </p>
              <p>a lo que te importa</p>
            </div>
          </div>
          <div className="container-icons">
            <ul className="list-social">
              <li className="social-link">
                <a href="https://www.facebook.com/profile.php?id=100066753159439">
                  <i className="ri-facebook-circle-line config-icon"></i>
                </a>
              </li>
              <li className="social-link">
                <a href="https://www.instagram.com/zagazine._/">
                  <i className="ri-instagram-line config-icon"></i>
                </a>
              </li>
              <li className="social-link">
                <a href="https://www.youtube.com/channel/UCAL9hCTUTE3Y5MGVOxhJQzg">
                  <i className="ri-youtube-line config-icon"></i>
                </a>
              </li>
            </ul>
          </div>
        </div>
        <div className="container-copyright">
          <p>Copyright © 2022 zagazine™ | Todos los derechos resevados |</p>
        </div>
      </footer>
    </div>
  );
}

export default Layout;
